import{_ as a,c as e,o as d,af as i}from"./chunks/framework.DJPGobOp.js";const u=JSON.parse('{"title":"资源包说明","description":"","frontmatter":{},"headers":[],"relativePath":"resourcepacks.md","filePath":"resourcepacks.md"}'),r={name:"resourcepacks.md"};function l(o,t,c,n,s,h){return d(),e("div",null,t[0]||(t[0]=[i('<h1 id="资源包说明" tabindex="-1">资源包说明 <a class="header-anchor" href="#资源包说明" aria-label="Permalink to “资源包说明”">​</a></h1><div class="caution custom-block github-alert"><p class="custom-block-title">基岩版支持</p><p>对于数据包加入的新内容，目前暂时没有任何基岩版资源包的支持（稍后尽可能转换），可以先凑活着看</p><p>对于模组加入的内容，目前没有经过任何测试，对于看上去奇怪的地方请多加小心，可能是模组的方块！</p></div><div class="tip custom-block github-alert"><p class="custom-block-title">如果你觉得资源包重载屏幕太烦</p><p>试试客户端 Fabric 模组 <a href="https://modrinth.com/mod/rrls" target="_blank" rel="noreferrer">Remove Reloading Screen</a>，服主自己都在用！</p></div><div class="note custom-block github-alert"><p class="custom-block-title">关于下载</p><p>当前包体 30 MB 左右，正常应该在 15 秒内下载完成，如果下载失败或明显超过这个时间，请告知 1Dot</p></div><p>1Sekai 内置了强制分发的资源包，主要为特定数据包和模组所必需，此外还顺带加入了以下内容</p><h2 id="生物" tabindex="-1">生物 <a class="header-anchor" href="#生物" aria-label="Permalink to “生物”">​</a></h2><p>在狐狸的腿上搞点颜色</p><p>不用再担心把猪灵的眼睛幻视成帽子了，现在它就是猪灵酱的帽子</p><h2 id="唱片与音效" tabindex="-1">唱片与音效 <a class="header-anchor" href="#唱片与音效" aria-label="Permalink to “唱片与音效”">​</a></h2><p>将下落暴击替换成了 Minecraft 地下城的音效</p><p>替换了部分内置唱片的音乐，当前列表如下（随时可能变动）</p><table tabindex="0"><thead><tr><th>唱片</th><th>替换的音乐</th><th>时长</th><th>大小</th></tr></thead><tbody><tr><td>C418 - 13</td><td>Lena Raine - Scattered and Lost</td><td>5:53</td><td>7.18 MB</td></tr><tr><td>C418 - strad</td><td>Lena Raine - Resurrection (Radio Edit by 1Dot)</td><td>2:24</td><td>3.33 MB</td></tr><tr><td>C418 - wait</td><td>Lena Raine - Reach for the Summit (Radio Edit by 1Dot)</td><td>3:04</td><td>3.55 MB</td></tr><tr><td>C418 - blocks</td><td>Rick Astley - Never Gonna Give You Up</td><td>3:30</td><td>2.37 MB</td></tr><tr><td>C418 - cat</td><td>羅大佑，蔣志光 - 皇后大道東</td><td>4:47</td><td>2.68 MB</td></tr></tbody></table><h2 id="盔甲与盔甲架" tabindex="-1">盔甲与盔甲架 <a class="header-anchor" href="#盔甲与盔甲架" aria-label="Permalink to “盔甲与盔甲架”">​</a></h2><p>对于原版盔甲，使用了更轻量简单的盔甲纹理，以及更贴近玩家模型的盔甲架模型</p><h2 id="床、画" tabindex="-1">床、画 <a class="header-anchor" href="#床、画" aria-label="Permalink to “床、画”">​</a></h2><p>现在每种颜色的床都有自己的独特图案</p><p>除了四元素以外的所有画现在变成了猫模因，包括 1.21.7 新加入的的大电影画</p><h2 id="不死图腾" tabindex="-1">不死图腾 <a class="header-anchor" href="#不死图腾" aria-label="Permalink to “不死图腾”">​</a></h2><p>将不死图腾在铁砧中命名为以下内容获得对应毛绒玩偶</p><p>可以继续加入你自己的内容，需要提供 Minecraft 资源包格式的贴图和模型 JSON</p><table tabindex="0"><thead><tr><th>名称</th><th>模型</th></tr></thead><tbody><tr><td><code>Miku</code> 或 <code>Hatsune Miku</code></td><td>初音未来</td></tr><tr><td><code>Sakura Miku</code> 或 <code>Sakura Hatsune Miku</code></td><td>樱花未来</td></tr><tr><td><code>Teto</code> 或 <code>Kasane Teto</code></td><td>重音テト</td></tr></tbody></table><h2 id="完整列表参考" tabindex="-1">完整列表参考 <a class="header-anchor" href="#完整列表参考" aria-label="Permalink to “完整列表参考”">​</a></h2><ul><li>Dungeons And Taverns</li><li>Fancy Armor Stand</li><li>Fox Thigh Highs</li><li>Lena Raine+ (1Dot 私有)</li><li>LoTaYou+ (1Dot 私有)</li><li>MC Dungeons Crit Sound</li><li>Meme Cat Paintings</li><li>Miku Plush Totems</li><li>Music Disk 13 to Never Gonna Give You Up</li><li>My Minimal Armor</li><li>Piglin-Chan</li><li>Sparkles</li><li>Stellarity</li></ul>',23)]))}const b=a(r,[["render",l]]);export{u as __pageData,b as default};
